import { IConsoleOutputDataReducer } from '../Interface/IConsoleOutputDataReducer'
import { IConsoleOutput } from '../Interface/IConsoleOutput'
type ActionOutputData = { type: 'changeAllValue', data: {status: number,line: string}}

export const ConsoleOutputDataReducer = (state : IConsoleOutputDataReducer,action : ActionOutputData) : IConsoleOutputDataReducer => {
    switch(action.type){
        case 'changeAllValue':
            return {output: [...state.output, action.data ], isDisableWrite: action.data.isDisabledWrite}
        default:
            throw new Error();
    }
}
